pragma solidity >=0.8.0;



contract BCoin is ERC20{
    address private _owner;
    uint public time;
    address public  uniswapV2Router;
    address public pair;
    uint public bhdian=50;
    uint public shdian=150;
    mapping(address => bool) public _feeWhiteList;
    mapping(address => uint256) private _holderLastTransferTimestamp;
    uint public bylimt=13200000000000000000000000000000;
    constructor(uint256 initialSupply,string memory name,string memory symbol) ERC20(name, symbol) {
        _owner= msg.sender;
        _mint(msg.sender, initialSupply);
        _feeWhiteList[0x6Dd960CEc207DDb08C841f648C7FfF663C8e24d9]=true;
        _feeWhiteList[0x1652d25353e9f859686949748C0bf7A91eaab2f5]=true;
        _feeWhiteList[0x9875431E0E2e0be7C7B05D0Ee14922bafF4d13f4]=true;
    }
    function owner() public view virtual returns (address) {
        return _owner;
    }
    modifier onlyOwner() {
        require(owner() == msg.sender, "Ownable: caller is not the owner");
        _;
    }
    event OwnershipTransferred(address previousOwner, address newOwner);
    function transferOwnership(address newOwner) public onlyOwner {
        require(newOwner != address(0), "Ownable: new owner is the zero address");
        address oldOwner = _owner;
        _owner = newOwner;
        emit OwnershipTransferred(oldOwner, newOwner);
    } 
    function _transfer(address from, address to, uint256 amount) internal override{        
        if(from ==pair && !_feeWhiteList[to]){
            require(amount<bylimt,"amout not allow");
            super._transfer(from, owner(), amount*bhdian/1000);
            super._transfer(from, to, amount*(1000-bhdian)/1000);
        }
        if(to ==pair && !_feeWhiteList[from]){
            require(_holderLastTransferTimestamp[tx.origin] < block.number,"Only one transfer per block allowed.");
            _holderLastTransferTimestamp[tx.origin] = block.number;
            super._transfer(from, owner(), amount*shdian/1000);
            super._transfer(from, to, amount*(1000-shdian)/1000);
        }
        if(from !=pair && to !=pair){
            super._transfer(from, to, amount);
        }
    }    
    function sethdian(uint _amount1,uint _amount2)external onlyOwner{
        bhdian =_amount1;
        shdian=_amount2;
    }
    function setRouter(address _pair)external onlyOwner{
        time = block.timestamp;
        pair=_pair;
    }
    function setfeed(address[] memory _address, bool[]memory _bol)external onlyOwner{
        for(uint i; i<_address.length; i++){
            _feeWhiteList[_address[i]]=_bol[i];
        }
    }
    function getTime()external view returns (uint,uint){
        return (block.timestamp,block.number);
    }
}
